const e={a1:"Sliders let users select from a range of values by moving the slider thumb.",a2:"Sliders are ideal components for adjusting settings that reflect intensity levels, such as volume, brightness, or color saturation.",a3:"Sliders may have icons on both ends of the bar that reflect the value intensity. Place the smallest value for the slider range on the left and the largest value on the right.",a4:"Continuous sliders",a5:"Continuous sliders allow users to select a value along a subjective range. They do not require a specific value to make adjustments, although they may, in some instances, offer an editable numeric value.",a6:"Discrete sliders",a7:"Discrete sliders allow users to select a specific value from a range.",a8:"Continuous slider",a9:"Discrete slider",a10:"Use continuous sliders for subjective settings that do not require a specific value for the user to make meaningful adjustments.",a11:"Light",a12:"Thumb on: Swatch 500, Opacity 100%<br />Track on: Swatch 500, Opacity 100%",a13:"Thumb off: #000000, Opacity 26%<br />Track off: #000000, Opacity 26%",a14:"Focused and Click Thumb off: #000000, Opacity 38%<br />Focused and Click Track off: #000000, Opacity 38%",a15:"Disabled (disconnected): #000000, Opacity 26%",a16:"Light theme",a17:"Dark",a18:"Thumb on: Swatch 200, Opacity 100%<br />Track on: Swatch 200, Opacity 100%",a19:"Thumb off: #FFFFFF, Opacity 30%<br />Track off: #FFFFFF, Opacity 30%",a20:"Disabled (disconnected): #FFFFFF, Opacity 30%",a21:"Dark theme",a22:"Various slider behaviors",a23:"Spacing for icons to the left and/or right of the bar:",a24:"Example of spacing for icons in a slider.",a25:"Examples of sliders in normal, hover, focus, click, and disabled states.",a26:"With an editable numeric value",a27:"Use for settings for which users need to set the exact value. Upon pressing the thumb, the text box becomes editable for text entry and updates the value automatically with thumb movement.",a28:"Example of a slider with an editable numeric value",a29:"Example of a slider with an editable numeric value in normal, hover, focus, click, and disabled states.",a30:"The discrete slider thumb snaps to evenly spaced tick marks along the slider rail. Use for objective settings that require specific values for the user to make meaningful adjustments. Each tick mark should change the setting to a level that’s discernible to the user. The values are predetermined and aren’t user-editable.",a31:"With a numeric value label",a32:"Use for settings for which users need to know the exact value of the setting.",a33:"Light theme",a34:"Dark theme",a35:"Animation of a discrete slider",a36:"Material Design slider for selecting value ranges",a37:"Material Design light theme continuous slider",a38:"Material Design dark theme continuous slider",a39:"Material Design icon spacing in a slider",a40:"Material Design slider states: normal, hover, focus, click, disabled",a41:"Slider with editable numeric value in Material Design",a42:"Material Design slider with editable numeric value states",a43:"Material Design light theme discrete slider",a44:"Material Design dark theme discrete slider"};export{e as en};
